import {
  state,
  derived,
  action,
  persistLocalStorage,
} from 'react-understate';

// Types
export type Todo = {
  id: number;
  text: string;
  completed: boolean;
};

export type FilterType = 'all' | 'active' | 'completed';

// State variables
const todos = state<Todo[]>([], 'todos');
const filter = state<FilterType>('all', 'todosFilter');
const newTodo = state('', 'newTodo');

// Persistence
persistLocalStorage(todos, 'todos');
persistLocalStorage(filter, 'todos-filter');

// Derived values
export const filteredTodos = derived(() => {
  switch (filter.value) {
    case 'active':
      return todos.value.filter(todo => !todo.completed);
    case 'completed':
      return todos.value.filter(todo => todo.completed);
    default:
      return todos.value;
  }
}, 'filteredTodos');

export const activeCount = derived(
  () => todos.value.filter(todo => !todo.completed).length,
  'activeCount',
);

export const completedCount = derived(
  () => todos.value.filter(todo => todo.completed).length,
  'completedCount',
);

export const totalCount = derived(() => todos.value.length, 'totalCount');

export const hasCompletedTodos = derived(
  () => completedCount.value > 0,
  'hasCompletedTodos',
);

export const allCompleted = derived(
  () => totalCount.value > 0 && activeCount.value === 0,
  'allCompleted',
);

// Actions
export const setNewTodo = action((text: string) => {
  newTodo.value = text;
}, 'setNewTodo');

export const setFilter = action((newFilter: FilterType) => {
  filter.value = newFilter;
}, 'setFilter');

export const addTodo = action(() => {
  if (newTodo.value.trim()) {
    todos.value = [
      ...todos.value,
      {
        id: Date.now(),
        text: newTodo.value.trim(),
        completed: false,
      },
    ];
    newTodo.value = '';
  }
}, 'addTodo');

export const toggleTodo = action((id: number) => {
  todos.value = todos.value.map(todo =>
    todo.id === id ? { ...todo, completed: !todo.completed } : todo,
  );
}, 'toggleTodo');

export const removeTodo = action((id: number) => {
  todos.value = todos.value.filter(todo => todo.id !== id);
}, 'removeTodo');

export const updateTodo = action((id: number, text: string) => {
  todos.value = todos.value.map(todo =>
    todo.id === id ? { ...todo, text } : todo,
  );
}, 'updateTodo');

export const clearCompleted = action(() => {
  todos.value = todos.value.filter(todo => !todo.completed);
}, 'clearCompleted');

export const toggleAll = action(() => {
  const shouldComplete = !allCompleted.value;
  todos.value = todos.value.map(todo => ({
    ...todo,
    completed: shouldComplete,
  }));
}, 'toggleAll');

// Export the complete store
export const todoStore = {
  // State access
  todos,
  filter,
  newTodo,
  
  // Computed values
  filteredTodos,
  activeCount,
  completedCount,
  totalCount,
  hasCompletedTodos,
  allCompleted,
  
  // Actions
  setNewTodo,
  setFilter,
  addTodo,
  toggleTodo,
  removeTodo,
  updateTodo,
  clearCompleted,
  toggleAll,
};`}),i("h2",{children:"Using the Store in Components"}),i("p",{children:"With the store pattern, components become simple and focused on rendering. All business logic is contained in the store:"}),i(A,{language:"tsx",code:`// TodoApp.tsx
import React from 'react';
import { useUnderstate } from 'react-understate';
import { todoStore } from './todoStore';

function TodoApp() {
  const {
    filteredTodos,
    newTodo,
    activeCount,
    hasCompletedTodos,
    filter,
    addTodo,
    setNewTodo,
    toggleTodo,
    removeTodo,
    setFilter,
    clearCompleted,
    toggleAll,
  } = useUnderstate(todoStore);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    addTodo();
  };

  return (
    <div className="todo-app">
      <header>
        <h1>Todos</h1>
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            placeholder="What needs to be done?"
            value={newTodo}
            onChange={(e) => setNewTodo(e.target.value)}
          />
        </form>
      </header>

      <main>
        {filteredTodos.length > 0 && (
          <button onClick={toggleAll}>
            {allCompleted ? '☑️' : '☐'} Toggle All
          </button>
        )}

        <ul className="todo-list">
          {filteredTodos.map(todo => (
            <li key={todo.id} className={todo.completed ? 'completed' : ''}>
              <input
                type="checkbox"
                checked={todo.completed}
                onChange={() => toggleTodo(todo.id)}
              />
              <span>{todo.text}</span>
              <button onClick={() => removeTodo(todo.id)}>×</button>
            </li>
          ))}
        </ul>
      </main>

      <footer>
        <span>{activeCount} items left</span>
        
        <div className="filters">
          {(['all', 'active', 'completed'] as const).map(filterType => (
            <button
              key={filterType}
              className={filter === filterType ? 'active' : ''}
              onClick={() => setFilter(filterType)}
            >
              {filterType.charAt(0).toUpperCase() + filterType.slice(1)}
            </button>
          ))}
        </div>

        {hasCompletedTodos && (
          <button onClick={clearCompleted}>
            Clear completed
          </button>
        )}
      </footer>
    </div>
  );
}`}),i("h2",{children:"Store Composition"}),i("p",{children:"For larger applications, you can compose multiple stores together. This allows you to organize code by feature or domain:"}),i(A,{language:"tsx",code:`// Compose multiple stores
