export const inputDigit = action((digit: string) => {
  if (waitingForOperand.value) {
    displayValue.value = digit;
    waitingForOperand.value = false;
  } else {
    displayValue.value = displayValue.value === '0' ? digit : displayValue.value + digit;
  }
}, 'inputDigit');

